        <div class="w-2/3 mx-auto mt-4 sm:mt-32">
          <h3 class="text-3xl font-extrabold leading-9 tracking-tight text-blue-800 sm:leading-10">
            Training Sessions

          </h3>



          <p>
            Prior to any training sessions, I encourage teams to take my free <a href="https://rfortherestofus.com/courses/getting-started/">Getting Started course</a>, which covers the basics of R. From there, training sessions provide the initial dive into R using a <a href="https://rfortherestofus.com/2019/06/what-is-a-tidyverse-centric-approach/">Tidyverse-centric approach</a>.
          </p>

          <p>
            All custom training is designed around projects that your organization is working on. Working with your data makes learning easier because it allows your team to focus on learning R, not having to remember details about a new dataset. And it shows staff how this new tool can help them solve problems they already encounter in their work.

          </p>
        </div>
      </div>

